    false,nt"url": null,nt"notes": "NODC Accession 0130368 contains raw underway
    meteorological, navigational, optical, physical, profile and time series data logged
    by the Scientific Computer System (SCS) aboard NOAA Ship Oscar Elton Sette in the
    North Pacific Ocean from 2015-04-03 to 2015-04-15. Office of Marine and Aviation
    Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NODC. In addition, NODC Accession 0130368 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
    and NODC personnel developed the automated process to archive these data under the
